import React from "react";
import Link from "@material-ui/core/Link";

export default async function add(something) {
  const url = "https://cubioinfo.com/aptitude-test/api/post/answersheets";
  function resetPage() {
    return (
      <Link href={`${process.env.PUBLIC_URL}`}>
        <button>เริ่มต้นทำแบบประเมินใหม่อีกครั้ง</button>
      </Link>
    );
  }
  try {
    console.log("try to fetch");
    const response = await fetch(url, {
      method: "POST",
      headers: {
        Authorization: "sometoken",
      },
      body: JSON.stringify({
        payload: something,
      }),
    });
    if (response.ok) {
      return await response;

      // return await response.json();
    }
    if (response.status <= 501) {
      alert("Status", response.status, resetPage());
      console.log(response.status);
      // eslint-disable-next-line prefer-promise-reject-errors
    }
    console.log("do it");
  } catch (error) {
    if (error.response) {
      /*
       * The request was made and the server responded with a
       * status code that falls out of the range of 2xx
       */
      console.log(error.response.data);
      console.log(error.response.status);
      alert("ปัญหา", error.response.status);
      console.log(error.response.headers);
    } else if (error.request) {
      /*
       * The request was made but no response was received, `error.request`
       * is an instance of XMLHttpRequest in the browser and an instance
       * of http.ClientRequest in Node.js
       */
      console.log(error.request);
    } else {
      // Something happened in setting up the request and triggered an Error
      console.log("Error", error.message);
    }
    console.log(error.config);
  }
}
